var route={};function ajax(t){$.ajax({url:t,headers:{Accept:"application/vnd.github.html"}}).done(function(t){$("main").html('<div class="bg-white rounded w-100 m-0 p-4">'+t+"</div>")})}function router(t){let e=$(location).attr("href");if(route[e])return $("main").html('<div class="text-center text-white bg-master rounded fs-4 w-100 m-0 p-4">Loading...</div>'),ajax(route[e])}$.getJSON("routes.json",function(t){route=t}),window.addEventListener("load",router),window.addEventListener("hashchange",router);
